const Direccion = ()=>{
    return (
      <div>
        <h2>Direccion</h2>
        <p>¡Descubre nuestras increíbles instalaciones!</p>
        
        {/* Embed de YouTube */}
        <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d937.2955962923049!2d-68.12985879831024!3d-16.505466433627642!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x915f21849c044d7f%3A0x8c47cc91605a7e59!2sPatio%20de%20comidas%20%22Estacion%20de%20Sabores%22!5e0!3m2!1ses!2sbo!4v1702409044654!5m2!1ses!2sbo" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
  
        <p>
          Aquí podríamos añadir una descripción detallada de las instalaciones del restaurante.
          Desde el comedor principal hasta la cocina, mostrando la experiencia y el ambiente único que ofrecemos.
        </p>
      </div>
    );
  };
  
  export default Direccion
